import React from 'react';
import DeleteIcon from '@material-ui/icons/Delete';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
const Note = () => {
    return (
        <>
            <div className="note">
                <h1> title </h1>

                <br />
                <p>This is The Content</p>
                <button>
                    <DeleteIcon className="deleteIcon" />
                </button>
            </div>
        </>
    );
}


export default Note;
